import * as React from 'react';

import * as S from './WinModal.style';

interface IProps {
    isOpen: boolean,
    playerName: string
}

const WinModal: React.FC<IProps> = ({ isOpen, playerName }) => (
    <S.WinModal isOpen={isOpen}>
        <S.Title>Congratulations</S.Title>
        <S.Text>Player { playerName } WIN!</S.Text>
        <S.RestartButton>Restart</S.RestartButton>
        <S.MenuButton>Menu</S.MenuButton>
    </S.WinModal>
);

export default WinModal;
